import React, { useState } from 'react';
import {
  Container, Navbar, Form, Button, InputGroup,
  Modal, ProgressBar
} from 'react-bootstrap';
import { Clipboard } from 'react-bootstrap-icons';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  const [url, setUrl] = useState('');
  const [loading, setLoading] = useState(false);
  const [progress, setProgress] = useState(0);
  const [showModal, setShowModal] = useState(false);
  const [result, setResult] = useState(null); // 'safe' o 'warning'
  const [copiado, setCopiado] = useState(false);

  const handleAnalyze = () => {
    if (!esUrlValida(url)) return;

    setLoading(true);
    setProgress(0);
    let current = 0;

    const interval = setInterval(() => {
      current += 10;
      setProgress(current);

      if (current >= 100) {
        clearInterval(interval);
        setLoading(false);
        const isGambling = Math.random() > 0.5;
        setResult(isGambling ? 'warning' : 'safe');
        setShowModal(true);
      }
    }, 200);
  };

  const handleCopy = () => {
    if (url) {
      navigator.clipboard.writeText(url);
      setCopiado(true);
      setTimeout(() => setCopiado(false), 2000);
    }
  };

  const esUrlValida = (texto) => {
    const pattern = /^(https?:\/\/)?([\w.-]+)\.([a-z]{2,})(\/\S*)?$/i;
    return pattern.test(texto);
  };

  return (
    <>
      <Navbar bg="success" variant="dark" className="px-4">
        <Navbar.Brand className="d-flex align-items-center">
          <img
            src="" // Coloca tu logo aquí si deseas
            width="32"
            height="32"
            className="me-2"
            alt="Logo"
          />
          <span className="fs-4 fw-semibold">GAnalysis</span>
        </Navbar.Brand>
      </Navbar>

      <Container className="my-5 text-center">
        <h2>Analiza los anuncios de la web</h2>
        <p className="mb-4">
          Mediante web scraping analizamos los anuncios de la web que elijas para prevenir que tenga anuncios referentes al gambling.
        </p>

        <InputGroup className="mb-3 w-75 mx-auto shadow-sm">
          <Form.Control
            placeholder="https://ejemplo.com"
            value={url}
            onChange={(e) => setUrl(e.target.value)}
          />
          <Button variant="outline-secondary" onClick={handleCopy}>
            <Clipboard />
          </Button>
        </InputGroup>
        {copiado && <small className="text-success">Copiado ✅</small>}

        <Button
          variant="success"
          onClick={handleAnalyze}
          disabled={!esUrlValida(url)}
        >
          ANALIZAR
        </Button>

        {loading && (
          <div className="w-75 mx-auto mt-4">
            <ProgressBar
              striped
              animated
              now={progress}
              label={`${progress}%`}
            />
          </div>
        )}
      </Container>

      <Modal show={showModal} onHide={() => setShowModal(false)} centered>
        <Modal.Body className="text-center">
          {result === 'safe' ? (
            <>
              <i className="bi bi-check-circle-fill text-success display-4 mb-3"></i>
              <p className="fs-5">
                ✅ No se ha detectado ningún tipo de anuncio referente al gambling.
              </p>
            </>
          ) : (
            <>
              <i className="bi bi-exclamation-triangle-fill text-danger display-4 mb-3"></i>
              <p className="fs-5">
                ⚠️ Advertencia, la página posee anuncios que dan promoción al gambling.
              </p>
            </>
          )}
        </Modal.Body>
      </Modal>

      <footer className="text-center text-white bg-success py-3 mt-5">
        GAnalysis © 2025 | Desarrollado para detectar amenazas de anuncios relacionados con gambling
      </footer>
    </>
  );
}

export default App;
